    if (!lists) {
        // Gérez le cas où les données ne sont pas disponibles ou sont incorrectes
        return <div>Erreur: Aucune liste trouvée.</div>;
    }

    return (
        <div>
            {/* Affichez les données ici */}
        </div>
    );
}

export default Archive;
